import React from "react";
import "./Home.css";

const Home = () => {
    return (
        <>
            <div className="title-container">
                <div>
                    Thiết Kế Xây Dựng Hệ Thống Trồng Rau Sạch Sử Dụng ESP32
                </div>
                <div className="information-container">
                    <div>Trần Văn Châu</div>
                    <div>N18DCDT006</div>
                </div>
            </div>
        </>
    );
};

export default Home;
